import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
// import './Navbar.css'; // Your custom CSS for Navbar

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: '#FC0E49' }}>
      <div className="container-fluid">
        <a className="navbar-brand text-white" href="#home"><b>Yasir Masood</b></a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <Link onClick={() => navigateTo("/home")} to="/home" className="nav-link text-white"  smooth={true} duration={500}><b>Home</b></Link>
            <Link onClick={() => navigateTo("/aboutus")} to="/aboutus" className="nav-link text-white"  smooth={true} duration={500} ><b>About</b></Link>
            <Link onClick={() => navigateTo("/skills")} to="/skills" className="nav-link text-white"  smooth={true} duration={500}><b>Skills</b></Link>
            <Link onClick={() => navigateTo("/portfolio")} to="/portfolio" className="nav-link text-white"  smooth={true} duration={500}><b>Portfolio</b></Link>
            <Link onClick={() => navigateTo("/contact")} to="/contact" className="nav-link text-white"  smooth={true} duration={500}><b>Contact</b></Link>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
